Nadat ze hun weg door de middelbare school hebben gevonden, vinden er grote veranderingen plaats 
voor officieren Schmidt (Jonah Hill) en Jenko (Channing Tatum) als ze dit keer undercover 
gaan op een plaatselijk college. 
Maar wanneer Jenko zijn verwante ziel tegenkomt in het footballteam en Schmidt 
infiltreert bij de kunstclub, beginnen ze hun partnerschap in twijfel te trekken. 
Het is aan hen de taak om niet alleen de zaak op te lossen, maar ook om beproevingen 
te doorstaan die zullen aantonen of ze een 'volwassen' relatie kunnen aangaan. 
Als de twee adolescenten kunnen uitgroeien tot 'echte' mannen, zou deze studententijd misschien 
wel het beste kunnen zijn dat hen ooit is overkomen.

After making their way through high school (twice), big changes are in store 
for officers Schmidt and Jenko when they go deep undercover at a local college.


